import React from "react";
import FlipCard from '../FlipCard'
import Road from "../Road"
import {Bar, Doughnut, Polar, Radar, HorizontalBar} from 'react-chartjs-2';


function RoadLevel3(props) {


    return (
        <div>
            
            <div style = {{display: 'flex', flexDirection: 'row', marginTop: '-0.4em',  alignItems: 'center'}}>
            <Road 
                width={'15em'}
                height= {'10em'}
                StylingInfo = {'horizontal-road1'} dashType = 'horizontal-dash'/>
                            
                <FlipCard
                  width = {"25em"}
                  height = {"15em"}
                  Front=
                  {
                    <div>
                      <h1 className = 'progLang-hF'>
                      {props.plChartData.frontTitle}
                      </h1>
                      <p style= {{position: 'fixed', bottom: -16, right:0, color:'yellow'}}>
                        {props.plChartData.clickMessage}
                      </p>
                    </div>
                  }
                  Back = {
                    <div>
                      <Doughnut data={props.plChartData.plChartData}
                        options= {props.plChartData.options}
                      />
                    </div>
                      }
                >
                </FlipCard>
                
                <Road 
                width={'15em'}
                height= {'10em'}
                StylingInfo = {'horizontal-road1'}
                dashType = 'horizontal-dash'/>

                {/* <Road 
                width={'10em'}
                height= {'10em'}
                StylingInfo = {'horizontal-road2'}
                top={'0.15em'}
                />  */}
            </div>
            </div>
        )              
}

export default RoadLevel3;
